import React from 'react'
import {Outlet,Navigate}	 from 'react-router-dom'

const PrivateRoute = () => {
	const auth = false
	if (auth===undefined) return 'Loading...'

  return (
    auth? <Outlet/> : <Navigate to="/auth"/>
  )
}

export default PrivateRoute
